import React from 'react';
import './RegAccComp.scss';

const RegAccComp = (props) => {
    return(
        <div className="RegAccCompMain">
            <div className="RegAccComp">
                <p>DANE FIRMY</p>
                <div className="RegAccCompData">
                </div>
            </div>
        </div>
    )
}

export default RegAccComp;
